  let { tenGhe } = props.SeatItem;
  // function renderSeatItem() {
  //   return;
  // }
  return (
    <>
      <span className="seat__wrapper">
        <span style={{ color: "white" }} className="seat__item">
          {nameCode}-{tenGhe}
        </span>
      </span>
    </>
  );
}

export default SeatItem;
